import {TiShoppingCart} from 'react-icons/ti'

export default function ListGames({game}) {
    return (
        <div>
            <h1>{game} </h1>
            <span>add to cart</span>
            <a><TiShoppingCart style={{cursor:"pointer"}}/></a>
        </div>
    )
}
